import React from "react";
import ListItem from "./ListItem";
import "../../index.css";

const List = ({
  todos,
  setTodo,
  fetchData,
  getTodosByFilter,
  listItemChange,
  deleteItemAPI,
}) => {
  return (
    <ul className="list">
      {getTodosByFilter.map((todo) => (
          todos.length>0 ?<ListItem
          fetchData={fetchData}
          deleteItemAPI={deleteItemAPI}
          listItemChange={listItemChange}
          setTodo={setTodo}
          todos={todos}
          todo={todo}
          key={todo.id}
        />: <li> No records found</li>
      ))}
    </ul>
  );
};

export default List;
